import React, { useState } from "react";
import styles from "./Profile.module.css";
import Button from "../UI/Button/Button.js";

const Profile = (props) => {
  let arr = props.authServices.getUsers();
  let loginWorker = props.authServices.getLastLogin();
  const user = arr.filter((element) => element.username === loginWorker);
  console.log(user);
  return (
    <div>
      <h3>Hello,{loginWorker}</h3>
      <div>
        <p>Counts of working hours:</p>
        <p>Room number for today:</p>
        <Button>Log out</Button>
      </div>
      <table>
    <thead>
      <tr>
        <th>Column 1</th>
        <th>Column 2</th>
        <th>Column 3</th>
      </tr>
    </thead>
    <tbody>
      <tr>
        <td>Row 1, Cell 1</td>
        <td>Row 1, Cell 2</td>
        <td>Row 1, Cell 3</td>
      </tr>
      <tr>
        <td>Row 2, Cell 1</td>
        <td>Row 2, Cell 2</td>
        <td>Row 2, Cell 3</td>
      </tr>
      <tr>
        <td>Row 3, Cell 1</td>
        <td>Row 3, Cell 2</td>
        <td>Row 3, Cell 3</td>
      </tr>
    </tbody>
  </table>
    </div>
  );
};
export default Profile;
